window.ListUtils={move:function(n,e,r,t){for(var i in n)if(t==n[i][r]){e.push(n[i]),n.splice(i,1);break}},moveAll:function(n,e){for(var r in n)e.push(n[r]);n.splice(0,n.length)},removeDuplicates:function(n,e,r){for(var t in n)this.remove(e,r,n[t][r])},remove:function(n,e,r){for(var t=n.length,i=0;i!=t&&n[i];)n[i][e]==r?n.splice(i,1):++i},getIndex:function(n,e,r){for(var t=0,i=n.length;t!=i;++t)if(n[t][e]==r)return t;return-1},getItem:function(n,e,r){for(var t=0,i=n.length;t!=i;++t)if(n[t][e]==r)return n[t];return null}};